import React from 'react'

export default function Cards() {
  return (
    <div>
       <div
          className="card mt-3 container "
          style={{ width: "18rem",margin:"1em" ,maxHeight: "360px" }}
        >
          {/* <img src="..." className="card-img-top" alt="..."> */}
          <div className="card-body container">
          <img src="https://source.unsplash.com/random/60Ã—40/?burger" className="d-block w-100"  style={{ width: "16rem", height: "14rem" }} alt="..."/>

            <h5 className="card-title">Card title</h5>
            <p className="card-text" style={{maxHeight: "60px" }}>>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <div className="container m-3 w-100"  style={{maxHeight: "60px" }}>
              <select className="m-2 w-40 h-80">
                {Array.from(Array(6), (e, i) => {
                  return (
                    <option key={i + 1} value={i + 1}>
                      {" "}
                      {i + 1}{" "}
                    </option>
                  );
                })}
              </select>
              <select className="m-2 w-40 h-80">
                <option value="half">Half</option>;
                <option value="full">Full</option>
              </select>
              <div className="d-inline  fs-5">Total Price</div>
            </div>
          </div>
        </div>
    </div>
  )
}
